func handle(s string) int{
	arr := s[:]
	lenth := len(s)
	set := map[string] int{}
	count := 0
	i := 0
	j := 0
	for i<lenth && j <lenth{
		if _,ok := set[string(arr[j])]; ok {
			delete(set, string(arr[i]))
			i++
		} else {
			set[string(arr[j])] = 1
			j++
			if count < j - i {
				count = j - i
			}
		}
	}
	return count
}